import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
} from 'chart.js'

ChartJS.register(
    LineElement,
    CategoryScale,
    LinearScale,
    PointElement
)

export default function Graph() {
    const data = {
        labels: [1, 2, 3],
        datasets: [{
            data: [4, 5, 6],
            backgroundColor: 'transparent',
            borderColor: '#f26c6d'
        }]
    }

    const options = {};


    return (
        <div style={{width: '500px', height: '500px', marginLeft: '20px'}}>
            <Line data={data} options={options}></Line>
        </div>
    )

};
